import * as React from 'react';
import { Accordion, AccordionSummary, ExpandMoreIcon, Typography } from '@material-ui/core';

export default function MainNav() {
  return (
    <div>
        <AccordionSummary
          expandIcon={<ExpandMoreIcon />}
          aria-controls="panel1a-content"
          id="panel1a-header"
        >
          <Typography>메뉴</Typography>
        </AccordionSummary>
      <Accordion>
        <AccordionSummary
          expandIcon={<ExpandMoreIcon />}
          aria-controls="panel2a-content"
          id="panel2a-header"
        >
          <Typography>홈</Typography>
        </AccordionSummary>
      </Accordion>
    </div>
  );
}
